import './search.css';
import {useEffect, useRef, useState} from 'react';
import axios from 'axios';
<script src="https://cdn.jsdelivr.net/npm/bootstrap@5.1.3/dist/js/bootstrap.bundle.min.js" integrity="sha384-ka7Sk0Gln4gmtz2MlQnikT1wXgYsOg+OMhuP+IlRH9sENBO0LRn5q+8nbTov4+1p" crossorigin="anonymous"></script>

const Search2 =() => {

    const [movies,setMovies] = useState([]);
    const url = "https://www.omdbapi.com/?apikey=5e1f4b00"

    const searchByTitle = async() => {
        const response = await axios.get(`${url}&s=batman`)
        setMovies(response.data.Search)
    }

    useEffect(()=>{
        searchByTitle()
    },[])

    return( 
        <>

        <div id='abhi'>abhi</div>
        <div className='searchbar'>

            <input className='inputSearch'  placeholder='search any movie'></input>
            <button className='button'>Search</button>


            <ul className='list-group'>
                {
                    movies.map(movie=> {
                        <li className='list-group-item'>
                            <img src={movie.Poster} height={20} alt="" />
                            {movie.title}
                        </li>
                    })
                }

            </ul>

<pre>

            {JSON.stringify(movies,null,2)}
</pre>


        </div>
        </>

    )
}

export default Search2;
